import React from 'react'
import './footerstyle.css'

function Footer() {
    return (<>
        {/* <div className="social-menu"> */}
        <ul className="list">

            <li className="listli"><a href="https://www.facebook.com/Amoseman18/"><i className="fab fa-facebook" id="icon"></i></a></li>

            <li className="listli"><a href="https://github.com/amoseman1"><i className="fab fa-github" id="icon"></i></a></li>

            <li className="listli"><a href="https://www.linkedin.com/in/amy-moseman-7867a9158"><i className="fab fa-linkedin" id="icon"></i></a></li>
            <i className="far fa-copyright">Amy Moseman</i>
        </ul>
        {/* </div> */}
    </>
    )
}

export default Footer
